import React,{Component} from 'react';
class Header extends Component
{
    render()
    {
        return(
            <div className="container">
                <div className="header-flex">
                    <p className="Zomato">Zomato</p>
                    <i class="fas fa-mobile"></i>
                </div>
            </div>
        )
    }
}
export default Header;
